n=A.m2(o,4,A.a([A.a_("It is also an offence if anyone attempts to do any of these acts.","\u092f\u0926\u093f \u0915\u094b\u0908 \u0907\u0928\u092e\u0947\u0902 \u0938\u0947 \u0915\u094b\u0908 \u092d\u0940 \u0915\u093e\u092e \u0915\u0930\u0928\u0947 \u0915\u093e \u0915\u094b\u0936\u093f\u0936 \u0915\u0930\u0924\u093e \u0939\u0948 \u0924\u094b \u092f\u0939 \u092d\u0940 \u0905\u092a\u0930\u093e\u0927 \u0939\u0948\u0964",i,i,!0),A.a_("What should you do if you have been a victim of sexual violence?","\u0905\u0917\u0930 \u0906\u092a \u092f\u094c\u0928 \u0939\u093f\u0902\u0938\u093e \u0915\u093e \u0936\u093f\u0915\u093e\u0930 \u0939\u0941\u090f \u0939\u0948\u0902 \u0924\u094b \u0906\u092a\u0915\u094b \u0915\u094d\u092f\u093e \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u093f\u090f?",h,i,!1),A.a_("If you have faced any form of sexual violence as mentioned above, and want to report it, you can:","\u0905\u0917\u0930 \u0906\u092a\u0928\u0947 \u0915\u093f\u0938\u0940 \u092d\u0940 \u0924\u0930\u0939 \u0915\u0940 \u092f\u094c\u0928 \u0939\u093f\u0902\u0938\u093e \u0915\u093e \u0938\u093e\u092e\u0928\u093e \u0915\u093f\u092f\u093e \u0939\u0948, \u0914\u0930 \u0907\u0938\u0915\u0940 \u0930\u093f\u092a\u094b\u0930\u094d\u091f \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u0924\u0947 \u0939\u0948\u0902, \u0924\u094b \u0906\u092a \u092f\u0939 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902",i,i,!0),A.a_(i,i,i,a6,!0),A.a_("Approach the nearest police station and make a complaint orally or in writing which will be recorded. The police will file a report. If required, they will also take you to a hospital for free medical treatment.","\u092a\u093e\u0938 \u0915\u0947 \u092a\u0941\u0932\u093f\u0938 \u0938\u094d\u091f\u0947\u0936\u0928 \u0938\u0947 \u0938\u0902\u092a\u0930\u094d\u0915 \u0915\u0930\u0947\u0902 \u0914\u0930  \u092e\u0941\u0902\u0939-\u091c\u093c\u092c\u093e\u0928\u0940 \u092f\u093e \u0932\u093f\u0916 \u0915\u0947 \u0936\u093f\u0915\u093e\u092f\u0924 \u0926\u0930\u094d\u091c \u0915\u0930\u0947\u0902\u0964 \u092a\u0941\u0932\u093f\u0938 \u0930\u093f\u092a\u094b\u0930\u094d\u091f \u0926\u0930\u094d\u091c \u0915\u0930\u0947\u0917\u0940\u0964 \u091c\u0930\u0942\u0930\u0924 \u092a\u0921\u093c\u0928\u0947 \u092a\u0930 \u0935\u0947 \u0906\u092a\u0915\u094b \u092e\u0941\u092b\u094d\u0924 \u0907\u0932\u093e\u091c \u0915\u0947 \u0932\u093f\u090f \u0905\u0938\u094d\u092a\u0924\u093e\u0932 \u092d\u0940 \u0932\u0947 \u091c\u093e\u090f\u0902\u0917\u0947\u0964",i,i,!0),A.a_(" If you are unable to go to any of these places directly for any reason, you can approach an NGO or a lawyer who will help you go to the police station or hospital.","\u092f\u0926\u093f \u0906\u092a \u0907\u0928\u092e\u0947\u0902 \u0938\u0947 \u0915\u093f\u0938\u0940 \u092d\u0940 \u091c\u0917\u0939 \u092a\u0930 \u0915\u093f\u0938\u0940 \u092d\u0940 \u0915\u093e\u0930\u0923 \u0938\u0947 \u0938\u0940\u0927\u0947 \u0928\u0939\u0940\u0902 \u091c\u093e \u0938\u0915\u0924\u0947 \u0939\u0948\u0902, \u0924\u094b \u0906\u092a \u0915\u093f\u0938\u0940 \u0917\u0948\u0930 \u0938\u0930\u0915\u093e\u0930\u0940 \u0938\u0902\u0917\u0920\u0928 \u092f\u093e \u0935\u0915\u0940\u0932 \u0938\u0947 \u0938\u0902\u092a\u0930\u094d\u0915 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902 \u091c\u094b \u0906\u092a\u0915\u094b \u092a\u0941\u0932\u093f\u0938 \u0938\u094d\u091f\u0947\u0936\u0928 \u092f\u093e \u0905\u0938\u094d\u092a\u0924\u093e\u0932 \u091c\u093e\u0928\u0947 \u092e\u0947\u0902 \u092e\u0926\u0926 \u0915\u0930\u0947\u0917\u093e\u0964",a1,i,!0),A.a_("After the police complaint, you will also have to explain your case to a magistrate.","\u092a\u0941\u0932\u093f\u0938 \u092e\u0947\u0902 \u0936\u093f\u0915\u093e\u092f\u0924 \u0915\u0947 \u092c\u093e\u0926 \u0906\u092a\u0915\u094b \u0905\u092a\u0928\u093e \u092e\u093e\u092e\u0932\u093e \u092e\u091c\u093f\u0938\u094d\u091f\u094d\u0930\u0947\u091f \u092f\u093e \u091c\u091c \u0915\u094b \u092d\u0940 \u092c\u0924\u093e\u0928\u093e \u0939\u094b\u0917\u093e\u0964",i,i,!0),A.a_("Once the investigation is complete, the case will go to the court and a lawyer will be appointed by the court, who will represent you and argue your case, free of cost.","\u090f\u0915 \u092c\u093e\u0930 \u091c\u093e\u0902\u091a \u092a\u0942\u0930\u0940 \u0939\u094b \u091c\u093e\u0928\u0947 \u0915\u0947 \u092c\u093e\u0926, \u092e\u093e\u092e\u0932\u093e \u0905\u0926\u093e\u0932\u0924 \u092e\u0947\u0902 \u091c\u093e\u090f\u0917\u093e \u0914\u0930 \u0905\u0926\u093e\u0932\u0924 \u0915\u0940 \u0924\u0930\u092b \u0938\u0947  \u090f\u0915 \u0935\u0915\u0940\u0932 \u0926\u093f\u092f\u093e \u091c\u093e\u090f\u0917\u093e, \u091c\u094b \u0906\u092a\u0915\u093e \u0915\u0947\u0938 \u0932\u095c\u0947\u0917\u093e \u0914\u0930 \u0906\u092a\u0915\u0947 \u092e\u093e\u092e\u0932\u0947 \u092e\u0947\u0902 \u092e\u0941\u092b\u094d\u0924 \u092e\u0947\u0902 \u092c\u0939\u0938 \u0915\u0930\u0947\u0917\u093e\u0964",c,i,!0),A.a_("You may be required to give evidence, but depending on the type of offence, this may take place in private chambers with a woman judge. If found guilty, the man who committed the act will be punished according to law.","\u0906\u092a\u0915\u094b \u0938\u092c\u0942\u0924 \u0926\u0947\u0928\u0947 \u0915\u0940 \u091c\u0930\u0942\u0930\u0924 \u092a\u0921 \u0938\u0915\u0924\u0940 \u0939\u0948, \u0932\u0947\u0915\u093f\u0928 \u0905\u092a\u0930\u093e\u0927 \u092f\u093e \u091c\u0941\u0930\u094d\u092e  \u0915\u093f\u0938 \u0924\u0930\u0939 \u0915\u093e \u0939\u0948 \u0909\u0938\u0915\u0947 \u0906\u0927\u093e\u0930 \u092a\u0930, \u092f\u0939 \u090f\u0915 \u092e\u0939\u093f\u0932\u093e \u0928\u094d\u092f\u093e\u092f\u093e\u0927\u0940\u0936 \u092f\u093e \u091c\u091c \u0915\u0947 \u0938\u093e\u0925 \u0928\u093f\u091c\u0940 \u0915\u0915\u094d\u0937\u094b\u0902 \u092f\u093e \u0915\u092e\u0930\u0947  \u092e\u0947\u0902 \u0939\u094b \u0938\u0915\u0924\u093e \u0939\u0948\u0964 \u0905\u0917\u0930 \u0915\u093c\u0938\u0942\u0930\u0935\u093e\u0930 \u092a\u093e\u092f\u093e \u091c\u093e\u0924\u093e \u0939\u0948, \u0924\u094b \u092f\u094c\u0928 \u0939\u093f\u0902\u0938\u093e \u0915\u0930\u0928\u0947 \u0935\u093e\u0932\u0947 \u0935\u094d\u092f\u0915\u094d\u0924\u093f \u0915\u094b \u0915\u093e\u0928\u0942\u0928 \u0915\u0940 \u0924\u0930\u092b \u0938\u0947 \u0938\u091c\u093e \u0926\u0940 \u091c\u093e\u092f\u0917\u0940\u0964",i,i,!0),A.a_(b,a,h,i,!1),A.a_(a7,a8,i,i,!0),A.a_(a9,"\u0906\u092a \u0906\u0927\u093f\u0915\u093e\u0930\u093f\u0915 \u0936\u093f\u0915\u093e\u092f\u0924 \u0926\u0930\u094d\u091c \u0928 \u0915\u0930\u0928\u0947 \u0915\u093e \u0924\u0930\u0940\u0915\u093e \u092d\u0940 \u091a\u0941\u0928 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902; \u0905\u092a\u0930\u093e\u0927 \u092f\u093e \u091c\u0941\u0930\u094d\u092e \u0915\u0940 \u0930\u093f\u092a\u094b\u0930\u094d\u091f \u0915\u0930\u0928\u093e \u0906\u092a\u0915\u093e \u092b\u0948\u0938\u0932\u093e \u0939\u0948\u0964 \u0905\u0917\u0930 \u0906\u092a\u0915\u093e \u0915\u094b\u0908 \u091c\u093e\u0928 \u092a\u0939\u091a\u093e\u0928 \u0935\u093e\u0932\u093e \u0935\u094d\u092f\u0915\u094d\u0924\u093f  \u0915\u093f\u0938\u0940 \u092f\u094c\u0928 \u092f\u093e \u0932\u093f\u0902\u0917 \u0906\u0927\u093e\u0930\u093f\u0924 \u0939\u093f\u0902\u0938\u093e \u0915\u093e \u0936\u093f\u0915\u093e\u0930 \u0939\u0941\u0906 \u0939\u0948, \u0924\u094b \u0906\u092a\u0915\u094b \u0909\u0928\u0915\u0940 \u0907\u091c\u093e\u091c\u0924 \u0915\u0947 \u092c\u093f\u0928\u093e \u0918\u091f\u0928\u093e \u0915\u0940 \u0930\u093f\u092a\u094b\u0930\u094d\u091f \u0928\u0939\u0940\u0902 \u0915\u0930\u0928\u0940 \u091a\u093e\u0939\u093f\u090f\u0964",i,i,!0),A.a_(f,e,g,i,!0)],c4),!0,"assets/images/title/ima5.png","Other forms of Sexual and gender based Violence","\u092f\u094c\u0928 \u0939\u093f\u0902\u0938\u093e \u0915\u0947 \u0905\u0928\u094d\u092f \u0930\u0942\u092a",n)
o=A.a([A.cs(i,!0,"Sexual harassment at the workplace includes unwelcome acts or behaviour from a colleague, employer, or anyone else associated with the place of work.\nIt includes","\u0915\u093e\u092e \u0915\u0930\u0928\u0947 \u0915\u0940 \u091c\u0917\u0939 \u092a\u0930 \u092f\u094c\u0928 \u0909\u0924\u094d\u092a\u0940\u0921\u093c\u0928 \u092e\u0947\u0902 \u0915\u093f\u0938\u0940 \u0938\u093e\u0925 \u0915\u093e\u092e \u0915\u0930\u0928\u0947 \u0935\u093e\u0932\u0947 ,\u0915\u093e\u092e \u092a\u0947 \u0930\u0916\u0928\u0947 \u0935\u093e\u0932\u0947  \u092f\u093e  \u0915\u093e\u092e \u0915\u0930\u0928\u0947 \u0915\u0940 \u091c\u0917\u0939 \u0938\u0947 \u091c\u0941\u0921\u093c\u0947 \u0915\u093f\u0938\u0940 \u0905\u0928\u094d\u092f \u0907\u0902\u0938\u093e\u0928 \u0915\u0940 \u0924\u0930\u092b \u0938\u0947 \u0915\u093f\u090f \u0917\u090f \u0928\u093e\u092a\u0938\u0928\u094d\u0926 \u0915\u093e\u092e \u092f\u093e \u0935\u094d\u092f\u0935\u0939\u093e\u0930 \u0936\u093e\u092e\u093f\u0932 \u0939\u0948\u0902\u0964 \u0907\u0938\u092e\u0947\u0902")],c0)
m=A.a([A.cn(i,i,"assets/images/harasment/6w1.png","Unwanted touching","\u0905\u0928\u091a\u093e\u0939\u093e \u0938\u094d\u092a\u0930\u094d\u0936 \u0915\u0930\u0928\u093e"),A.cn(i,i,"assets/images/harasment/6w2.png","Asking for sex","\u0938\u0947\u0915\u094d\u0938 \u0915\u0947 \u0932\u093f\u090f \u092a\u0942\u091b\u0928\u093e"),A.cn(i,i,"assets/images/harasment/6w3.png","Passing sexual comments","\u092f\u094c\u0928 \u091f\u093f\u092a\u094d\u092a\u0923\u093f\u092f\u093e\u0902 \u0915\u0930\u0928\u093e \u092f\u093e \u092f\u094c\u0928 \u092c\u093e\u0924\u0947 \u0915\u0939\u0928\u093e"),A.cn(i,i,"assets/images/harasment/6w4.png","Making you watch porn","\u0906\u092a\u0915\u094b \u092a\u094b\u0930\u094d\u0928 \u092f\u093e \u0905\u0936\u094d\u0932\u0940\u0932 \u092b\u094b\u091f\u094b \u092f\u093e \u0935\u0940\u0921\u093f\u092f\u094b \u0926\u093f\u0916\u093e\u0928\u093e")],c2)
m=A.m2(o,5,A.a([A.a_("You might also be promised better work or threatened with worse work along with this inappropriate behaviour.","\u0907\u0938 \u0905\u0928\u0941\u091a\u093f\u0924 \u092f\u093e \u0928\u093e\u091c\u093e\u092f\u091c \u0935\u094d\u092f\u0935\u0939\u093e\u0930 \u0915\u0947 \u0938\u093e\u0925 \u0906\u092a\u0915\u094b \u092c\u0947\u0939\u0924\u0930 \u0915\u093e\u092e \u0915\u093e \u0935\u093e\u0926\u093e \u092d\u0940 \u0915\u093f\u092f\u093e \u091c\u093e \u0938\u0915\u0924\u093e \u0939\u0948 \u092f\u093e \u092c\u0926\u0924\u0930 \u0915\u093e\u092e \u0915\u0940 \u0927\u092e\u0915\u0940 \u092d\u0940 \u0926\u0940 \u091c\u093e \u0938\u0915\u0924\u0940 \u0939\u0948\u0964",i,i,!0),A.a_("It is important to know that you will not lose your job for complaining because you faced harassment.","\u092f\u0939 \u091c\u093e\u0928\u0928\u093e \u091c\u0930\u0942\u0930\u0940 \u0939\u0948 \u0915\u093f \u0906\u092a \u0936\u093f\u0915\u093e\u092f\u0924 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0905\u092a\u0928\u0940 \u0928\u094c\u0915\u0930\u0940 \u0928\u0939\u0940\u0902 \u0916\u094b\u090f\u0902\u0917\u0947 \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u0906\u092a\u0915\u094b \u0909\u0924\u094d\u092a\u0940\u0921\u093c\u0928/ \u0905\u0924\u094d\u092f\u093e\u091a\u093e\u0930 \u0915\u093e \u0938\u093e\u092e\u0928\u093e \u0915\u0930\u0928\u093e \u092a\u0921\u093c\u093e \u0925\u093e\u0964",i,i,!0),A.a_("What should you do if you face sexual harasament at your workplace?","\u0905\u0917\u0930 \u0906\u092a \u0905\u092a\u0928\u0947 \u0915\u093e\u092e \u0915\u0930\u0928\u0947 \u0915\u0940 \u091c\u0917\u0939 \u092a\u0930 \u092f\u094c\u0928 \u0909\u0924\u094d\u092a\u0940\u0921\u093c\u0928/ \u0905\u0924\u094d\u092f\u093e\u091a\u093e\u0930 \u0915\u093e \u0938\u093e\u092e\u0928\u093e \u0915\u0930\u0924\u0947 \u0939\u0948\u0902 \u0924\u094b \u0906\u092a\u0915\u094b \u0915\u094d\u092f\u093e \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u093f\u090f?",h,i,!1),A.a_("If your organisation has an internal complaints committee (ICC), you can approach the committee to report the incident. If not, there are local committees in every district that can be approached. If you don\u2019t have access to either of them, you can also approach the magistrate.","\u0905\u0917\u0930 \u0906\u092a\u0915\u0947 \u0938\u0902\u0917\u0920\u0928/ \u0938\u0902\u0938\u094d\u0925\u093e \u092e\u0947\u0902 \u0906\u0902\u0924\u0930\u093f\u0915 \u0936\u093f\u0915\u093e\u092f\u0924 \u0938\u092e\u093f\u0924\u093f (\u0906\u0908\u0938\u0940\u0938\u0940) \u0939\u0948, \u0924\u094b \u0906\u092a \u0918\u091f\u0928\u093e \u0915\u0940 \u0930\u093f\u092a\u094b\u0930\u094d\u091f \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0938\u092e\u093f\u0924\u093f \u0938\u0947 \u0938\u0902\u092a\u0930\u094d\u0915 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902\u0964 \u0905\u0917\u0930 \u0928\u0939\u0940\u0902, \u0924\u094b \u0939\u0930 \u091c\u093f\u0932\u0947 \u092e\u0947\u0902 \u0938\u094d\u0925\u093e\u0928\u0940\u092f/ \u0932\u094b\u0915\u0932 \u0938\u092e\u093f\u0924\u093f\u092f\u093e\u0901 \u0939\u0948\u0902 \u091c\u093f\u0928\u0938\u0947 \u0938\u0902\u092a\u0930\u094d\u0915 \u0915\u093f\u092f\u093e \u091c\u093e \u0938\u0915\u0924\u093e \u0939\u0948\u0964 \u0905\u0917\u0930 \u0906\u092a\u0915\u0947 \u092a\u093e\u0938 \u0907\u0928\u092e\u0947\u0902 \u0938\u0947 \u0915\u093f\u0938\u0940 \u090f\u0915 \u0924\u0915 \u0928\u0939\u0940\u0902 \u092a\u0939\u0941\u0902\u091a \u0938\u0915\u0924\u0947 \u0939\u0948, \u0924\u094b \u0906\u092a \u092e\u091c\u093f\u0938\u094d\u091f\u094d\u0930\u0947\u091f \u0938\u0947 \u092d\u0940 \u0938\u0902\u092a\u0930\u094d\u0915 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902\u0964",i,i,!0),A.a_(i,i,i,"assets/images/nf/seha1.png",!0),A.a_("When you file a complaint, you should also include names and details of witnesses in it. Don\u2019t worry, your complaint and the proceedings that follow will be kept completely confidential.","\u091c\u092c \u0906\u092a \u0936\u093f\u0915\u093e\u092f\u0924 \u0926\u0930\u094d\u091c \u0915\u0930\u0924\u0947 \u0939\u0948\u0902, \u0924\u094b \u0906\u092a\u0915\u094b \u0909\u0938\u092e\u0947\u0902 \u0917\u0935\u093e\u0939\u094b\u0902 \u0915\u0947 \u0928\u093e\u092e \u0914\u0930 \u0909\u0928\u0915\u0940 \u0938\u093e\u0930\u0940 \u091c\u093e\u0928\u0915\u093e\u0930\u0940  \u092d\u0940 \u0936\u093e\u092e\u093f\u0932 \u0915\u0930\u0928\u0940  \u091a\u093e\u0939\u093f\u090f\u0964 \u091a\u093f\u0902\u0924\u093e \u0928 \u0915\u0930\u0947\u0902, \u0906\u092a\u0915\u0940 \u0936\u093f\u0915\u093e\u092f\u0924 \u0914\u0930 \u0906\u0917\u0947 \u0915\u0940 \u0915\u093e\u0930\u094d\u092f\u0935\u093e\u0939\u0940 \u0915\u094b \u092a\u0942\u0930\u0940 \u0924\u0930\u0939 \u0917\u094b\u092a\u0928\u0940\u092f \u0930\u0916\u093e \u091c\u093e\u090f\u0917\u093e\u0964",i,i,!0),A.a_("If the abuser is found guilty, there are different punishments that could be given.","\u0905\u0917\u0930 \u0926\u0941\u0930\u094d\u0935\u094d\u092f\u0935\u0939\u093e\u0930 \u0915\u0930\u0928\u0947 \u0935\u093e\u0932\u093e \u0906\u0930\u094b\u092a\u0940 \u092a\u093e\u092f\u093e \u091c\u093e\u0924\u093e \u0939\u0948, \u0924\u094b \u0905\u0932\u0917-\u0905\u0932\u0917 \u0938\u091c\u093e \u0926\u093f \u091c\u093e \u0938\u0915\u0924\u0940 \u0939\u0948\u0902\u0964",i,i,!0),A.a_("Sometimes, disciplinary action is taken against the abuser, a written apology is asked from him, or he might even be terminated. In some cases, the woman may also receive a part of his salary as compensation for any suffering caused","\u0915\u092d\u0940-\u0915\u092d\u0940, \u0926\u0941\u0930\u094d\u0935\u094d\u092f\u0935\u0939\u093e\u0930 \u0915\u0930\u0928\u0947 \u0935\u093e\u0932\u0947 \u0915\u0947 \u0916\u093f\u0932\u093e\u092b \u0905\u0928\u0941\u0936\u093e\u0938\u0928-\u0938\u0902\u092c\u0902\u0927\u0940 \u0915\u093e\u0930\u094d\u0930\u0935\u093e\u0908 \u0915\u0940 \u091c\u093e\u0924\u0940 \u0939\u0948, \u0909\u0938\u0938\u0947 \u0932\u093f\u0916\u093f\u0924 \u092e\u093e\u092b\u0940 \u092e\u093e\u0902\u0917\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0915\u0939\u093e \u091c\u093e\u0924\u093e \u0939\u0948, \u092f\u093e \u0909\u0938\u0915\u094b \u0928\u094c\u0915\u0930\u0940 \u0938\u0947 \u092d\u0940 \u0928\u093f\u0915\u093e\u0932 \u0926\u093f\u092f\u093e \u091c\u093e\u0924\u093e \u0939\u0948\u0964 \u0915\u0941\u091b \u092e\u093e\u092e\u0932\u094b\u0902 \u092e\u0947\u0902, \u092e\u0939\u093f\u0932\u093e \u0915\u094b \u0909\u0938\u0915\u0947 \u0935\u0947\u0924\u0928 \u0915\u093e \u090f\u0915 \u0939\u093f\u0938\u094d\u0938\u093e \u0915\u093f\u0938\u0940 \u092d\u0940 \u0926\u0930\u094d\u0926 \u0915\u0947 \u092e\u0941\u0906\u0935\u091c\u0947 \u0915\u0947 \u0930\u0942\u092a \u092e\u0947\u0902 \u092d\u0940 \u092e\u093f\u0932 \u0938\u0915\u0924\u093e \u0939\u0948\u0964",i,i,!0),A.a_(b,a,h,i,!1),A.a_(a7,a8,i,i,!0),A.a_(a9,"\u0906\u092a \u0906\u0927\u093f\u0915\u093e\u0930\u093f\u0915 \u0936\u093f\u0915\u093e\u092f\u0924 \u0926\u0930\u094d\u091c \u0928 \u0915\u0930\u0928\u0947 \u0915\u093e \u0924\u0930\u0940\u0915\u093e \u092d\u0940 \u091a\u0941\u0928 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902; \u0905\u092a\u0930\u093e\u0927 \u0915\u0940 \u0930\u093f\u092a\u094b\u0930\u094d\u091f \u0915\u0930\u0928\u093e \u0906\u092a\u0915\u093e \u092b\u0948\u0938\u0932\u093e \u0939\u0948\u0964 \u092f\u0926\u093f \u0906\u092a\u0915\u093e \u0915\u094b\u0908 \u091c\u093e\u0928 \u092a\u0939\u091a\u093e\u0928 \u0935\u093e\u0932\u093e \u0915\u093e\u092e \u0915\u0930\u0928\u0947 \u0915\u0940 \u091c\u0917\u0939 \u092a\u0930 \u092f\u094c\u0928 \u0909\u0924\u094d\u092a\u0940\u0921\u093c\u0928/ \u0905\u0924\u094d\u092f\u093e\u091a\u093e\u0930 \u0915\u093e \u0936\u093f\u0915\u093e\u0930 \u0939\u0941\u0906 \u0939\u0948, \u0924\u094b \u0906\u092a\u0915\u094b \u0909\u0928\u0915\u0940 \u0907\u091c\u093e\u091c\u0924 \u0915\u0947 \u092c\u093f\u0928\u093e \u0918\u091f\u0928\u093e \u0915\u0940 \u0930\u093f\u092a\u094b\u0930\u094d\u091f \u0928\u0939\u0940\u0902 \u0915\u0930\u0928\u0940 \u091a\u093e\u0939\u093f\u090f\u0964",i,i,!0),A.a_(f,e,g,i,!0)],c4),!1,"assets/images/title/ima6.png","Sexual Harassment at the workplace","\u0915\u093e\u092e \u0915\u0930\u0928\u0947 \u0915\u0940 \u091c\u0917\u0939 \u092a\u0930 \u092f\u094c\u0928 \u0909\u0924\u094d\u092a\u0940\u0921\u093c\u0928 \u092f\u093e \u0905\u0924\u094d\u092f\u093e\u091a\u093e\u0930",m)
o=A.m2(A.a([A.cs(i,!0,"If you are forced to marry someone without your consent, even by your family, it is against the law. It is also punishable under law if a woman is kidnapped for the purpose of marrying someone. Any person carrying out such a marriage, including your family members, or the other person and their family members can get punished under the law.","\u0905\u0917\u0930 \u0906\u092a\u0915\u094b \u0915\u093f\u0938\u0940 \u0938\u0947 \u0906\u092a\u0915\u0940 \u092e\u0930\u094d\u091c\u0940 \u0915\u0947 \u092c\u093f\u0928\u093e \u0936\u093e\u0926\u0940 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u092e\u091c\u092c\u0942\u0930 \u0915\u093f\u092f\u093e \u091c\u093e\u0924\u093e \u0939\u0948, \u092f\u0939\u093e\u0902 \u0924\u0915 \u0915\u093f \u0906\u092a\u0915\u0947 \u092a\u0930\u093f\u0935\u093e\u0930 \u0915\u0940 \u0924\u0930\u092b \u0938\u0947 \u092d\u0940, \u092f\u0939 \u0915\u093e\u0928\u0942\u0928 \u0915\u0947 \u0916\u093f\u0932\u093e\u092b \u0939\u0948\u0964 \u092f\u0926\u093f \u0915\u093f\u0938\u0940 \u092e\u0939\u093f\u0932\u093e \u0915\u093e \u0905\u092a\u0939\u0930\u0923 \u0915\u093f\u0938\u0940 \u0938\u0947 \u0936\u093e\u0926\u0940 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0907\u0930\u093e\u0926\u0947 \u0938\u0947 \u0915\u093f\u092f\u093e \u091c\u093e\u0924\u093e \u0939\u0948 \u0924\u094b \u092f\u0939 \u0915\u093e\u0928\u0942\u0928 \u0915\u0947 \u0924\u0939\u0924 \u0938\u091c\u093e \u0926\u0947\u0928\u0947 \u0915\u0947 \u0932\u093e\u092f\u0915 \u092d\u0940 \u0939\u0948\u0964 \u0910\u0938\u093e \u0935\u093f\u0935\u093e\u0939 \u0915\u0930\u0928\u0947 \u0935\u093e\u0932\u093e \u0915\u094b\u0908 \u092d\u0940 \u0935\u094d\u092f\u0915\u094d\u0924\u093f, \u091c\u093f\u0938\u092e\u0947\u0902 \u0906\u092a\u0915\u0947 \u092a\u0930\u093f\u0935\u093e\u0930 \u0915\u0947 \u0932\u094b\u0917, \u092f\u093e \u0915\u094b\u0908 \u0914\u0930 \u0935\u094d\u092f\u0915\u094d\u0924\u093f \u0914\u0930 \u0909\u0928\u0915\u0947 \u092a\u0930\u093f\u0935\u093e\u0930 \u0915\u0947 \u0932\u094b\u0917 \u0936\u093e\u092e\u093f\u0932 \u0939\u0948\u0902, \u0915\u094b \u0915\u093e\u0928\u0942\u0928 \u0915\u0947 \u0924\u0939\u0924 \u0938\u091c\u093e \u0926\u0940 \u091c\u093e \u0938\u0915\u0924\u0940 \u0939\u0948\u0964")],c0),6,A.a([A.a_("What should you do if you are forced to marry someone?","\u0905\u0917\u0930 \u0906\u092a\u0915\u094b \u0915\u093f\u0938\u0940 \u0938\u0947 \u0936\u093e\u0926\u0940 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u092e\u091c\u092c\u0942\u0930 \u0915\u093f\u092f\u093e \u091c\u093e\u090f \u0924\u094b \u0906\u092a\u0915\u094b \u0915\u094d\u092f\u093e \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u093f\u090f?",h,i,!1),A.a_("If you are forced to marry someone without your consent, you can","\u0905\u0917\u0930 \u0906\u092a\u0915\u094b \u0906\u092a\u0915\u0940 \u092e\u0930\u094d\u091c\u0940 \u0915\u0947 \u092c\u093f\u0928\u093e \u0915\u093f\u0938\u0940 \u0938\u0947 \u0936\u093e\u0926\u0940 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u092e\u091c\u092c\u0942\u0930 \u0915\u093f\u092f\u093e \u091c\u093e\u0924\u093e \u0939\u0948, \u0924\u094b \u0906\u092a \u092f\u0939 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902",i,i,!0),A.a_("Call the police, Women Helpline (1091), or an NGO. You can also contact the protection officer of your area.","\u092a\u0941\u0932\u093f\u0938, \u092e\u0939\u093f\u0932\u093e \u0939\u0947\u0932\u094d\u092a\u0932\u093e\u0907\u0928 (1091), \u092f\u093e \u0915\u093f\u0938\u0940 \u0917\u0948\u0930 \u0938\u0930\u0915\u093e\u0930\u0940 \u0938\u0902\u0917\u0920\u0928 /\u090f\u0928\u091c\u0940\u0913 \u0915\u094b \u0915\u0949\u0932 \u0915\u0930\u0947\u0902\u0964 \u0906\u092a \u0905\u092a\u0928\u0947 \u0907\u0932\u093e\u0915\u0947 \u0915\u0947 \u0938\u0941\u0930\u0915\u094d\u0937\u093e \u0905\u0927\u093f\u0915\u093e\u0930\u0940 \u0938\u0947 \u092d\u0940 \u0938\u0902\u092a\u0930\u094d\u0915 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902\u0964",a1,i,!0),A.a_("The persons mentioned above will also help you approach a magistrate who can pass an order to prevent you from being married against your will. The abusers can be punished under the law if this order is violated.","\u0906\u092a\u0915\u0940 \u0936\u093f\u0915\u093e\u092f\u0924 \u0906\u092a\u0915\u094b \u090f\u0915 \u092e\u091c\u093f\u0938\u094d\u091f\u094d\u0930\u0947\u091f \u0938\u0947 \u0938\u0902\u092a\u0930\u094d\u0915 \u0915\u0930\u0928\u0947 \u092e\u0947\u0902 \u092d\u0940 \u092e\u0926\u0926 \u0915\u0930\u0947\u0917\u0940 \u091c\u094b \u0906\u092a\u0915\u0940 \u0907\u091a\u094d\u091b\u093e \u0915\u0947 \u092c\u0917\u0948\u0930 \u0906\u092a\u0915\u094b \u0936\u093e\u0926\u0940 \u0915\u0930\u0928\u0947 \u0938\u0947 \u0930\u094b\u0915\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u090f\u0915 \u0939\u0941\u0915\u094d\u092e \u0926\u0947 \u0938\u0915\u0924\u093e \u0939\u0948\u0964 \u0907\u0938 \u0939\u0941\u0915\u094d\u092e \u0915\u093e \u092a\u093e\u0932\u0928 \u0928 \u0915\u0930\u0928\u0947 \u092a\u0930 \u0905\u092a\u0930\u093e\u0927 \u0915\u0930\u0928\u0947 \u0935\u093e\u0932\u094b\u0902 \u0915\u094b \u0915\u093e\u0928\u0942\u0928 \u0915\u0947 \u0924\u0939\u0924 \u0938\u091c\u093e \u0926\u0940 \u091c\u093e \u0938\u0915\u0924\u0940 \u0939\u0948\u0964",i,i,!0),A.a_("What should you do if you or someone you know has been kidnapped to be forced into a marriage?","\u0905\u0917\u0930 \u0906\u092a\u0915\u093e \u092f\u093e \u0906\u092a\u0915\u0947 \u0915\u093f\u0938\u0940 \u091c\u093e\u0928\u0928\u0947 \u0935\u093e\u0932\u0947 \u0915\u093e \u0905\u092a\u0939\u0930\u0923 \u0915\u093f\u092f\u093e \u0917\u092f\u093e \u0939\u0948 \u091c\u092c\u0930\u0928 \u0935\u093f\u0935\u093e\u0939 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f, \u0924\u094b \u0906\u092a\u0915\u094b \u0915\u094d\u092f\u093e \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u093f\u090f?",h,i,!1),A.a_("Go to the nearest police station and file a complaint. You can also approach an NGO or lawyer for help if you cannot directly approach the police station for any reason.","\u092a\u093e\u0938 \u0915\u0947 \u092a\u0941\u0932\u093f\u0938 \u0938\u094d\u091f\u0947\u0936\u0928 \u092e\u0947\u0902 \u091c\u093e\u0915\u0930 \u0936\u093f\u0915\u093e\u092f\u0924 \u0926\u0930\u094d\u091c \u0915\u0930\u093e\u090f\u0902\u0964 \u092f\u0926\u093f \u0906\u092a \u0915\u093f\u0938\u0940 \u0935\u091c\u0939 \u0938\u0947 \u0938\u0940\u0927\u0947 \u092a\u0941\u0932\u093f\u0938 \u0938\u094d\u091f\u0947\u0936\u0928 \u0928\u0939\u0940\u0902 \u091c\u093e \u0938\u0915\u0924\u0947 \u0939\u0948\u0902 \u0924\u094b \u0906\u092a \u092e\u0926\u0926 \u0915\u0947 \u0932\u093f\u090f \u0915\u093f\u0938\u0940 \u0917\u0948\u0930 \u0938\u0930\u0915\u093e\u0930\u0940 \u0938\u0902\u0917\u0920\u0928 / \u090f\u0928\u091c\u0940\u0913 \u092f\u093e \u0935\u0915\u0940\u0932 \u0938\u0947 \u092d\u0940 \u0938\u0902\u092a\u0930\u094d\u0915 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902\u0964",c,i,!0),A.a_("After the police investigation, kidnapping cases will go to court, and a lawyer will be appointed for you by the court, who will represent your case, free of cost. If found guilty, your abusers would be punished under the law.","\u092a\u0941\u0932\u093f\u0938 \u091c\u093e\u0902\u091a \u0915\u0947 \u092c\u093e\u0926, \u0905\u092a\u0939\u0930\u0923 \u0915\u0947 \u092e\u093e\u092e\u0932\u0947 \u0905\u0926\u093e\u0932\u0924 \u092e\u0947\u0902 \u091c\u093e\u090f\u0902\u0917\u0947, \u0914\u0930 \u0905\u0926\u093e\u0932\u0924 \u0915\u0940 \u0924\u0930\u092b \u0938\u0947 \u0906\u092a\u0915\u0947 \u0932\u093f\u090f \u090f\u0915 \u0935\u0915\u0940\u0932 \u0926\u093f\u092f\u093e \u091c\u093e\u090f\u0917\u093e, \u091c\u094b \u0906\u092a\u0915\u0947 \u092e\u093e\u092e\u0932\u0947 \u0915\u094b \u092e\u0941\u092b\u094d\u0924 \u092e\u0947\u0902 \u0932\u095c\u0947\u0917\u093e\u0964 \u092f\u0926\u093f \u0926\u094b\u0937\u0940 \u092a\u093e\u092f\u093e \u091c\u093e\u0924\u093e \u0939\u0948, \u0924\u094b \u0906\u092a\u0938\u0947 \u0926\u0941\u0930\u094d\u0935\u094d\u092f\u0935\u0939\u093e\u0930/ \u0905\u0924\u094d\u092f\u093e\u091a\u093e\u0930 \u0915\u0930\u0928\u0947 \u0935\u093e\u0932\u094b\u0902 \u0915\u094b \u0915\u093e\u0928\u0942\u0928 \u0915\u0947 \u0924\u0939\u0924 \u0938\u091c\u093e \u0926\u0940 \u091c\u093e\u092f\u0917\u0940\u0964",i,i,!0),A.a_("What happens if a child is forced to marry?","\u0915\u094d\u092f\u093e \u0939\u094b\u0917\u093e \u0905\u0917\u0930 \u090f\u0915 \u092c\u091a\u094d\u091a\u0947 \u0915\u094b \u0936\u093e\u0926\u0940 \u0915\u0947 \u0932\u093f\u090f \u092e\u091c\u092c\u0942\u0930 \u0915\u093f\u092f\u093e \u091c\u093e\u0924\u093e \u0939\u0948?",b0,i,!1),A.a_("If you are under 18 years, as per Indian laws you are considered too young to marry with or without your consent.","\u0905\u0917\u0930 \u0906\u092a\u0915\u0940 \u0909\u092e\u094d\u0930 18 \u0935\u0930\u094d\u0937 \u0938\u0947 \u0915\u092e \u0939\u0948, \u0924\u094b \u092d\u093e\u0930\u0924 \u0915\u0947 \u0915\u093e\u0928\u0942\u0928\u094b\u0902 \u0915\u0947 \u0924\u0939\u0924 \u0906\u092a\u0915\u094b \u0906\u092a\u0915\u0940 \u0938\u0939\u092e\u0924\u093f \u0938\u0947 \u092f\u093e \u0906\u092a\u0915\u0940 \u0938\u0939\u092e\u0924\u093f \u0915\u0947 \u092c\u093f\u0928\u093e \u0935\u093f\u0935\u093e\u0939 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u092c\u0939\u0941\u0924 \u091b\u094b\u091f\u093e \u092e\u093e\u0928\u093e \u091c\u093e\u0924\u093e \u0939\u0948\u0964",i,i,!0),A.a_(i,i,i,"assets/images/nf/fm1.png",!0),A.a_("Child marriages are prohibited in India, and any person, including family members who permit a child marriage to take place will be punished according to law.","\u092d\u093e\u0930\u0924 \u092e\u0947\u0902 \u092c\u093e\u0932 \u0935\u093f\u0935\u093e\u0939 \u0915\u0930\u0928\u0947 \u0915\u0940 \u092e\u0928\u093e\u0939\u0940 \u0939\u0948\u0902, \u0914\u0930 \u092a\u0930\u093f\u0935\u093e\u0930 \u0915\u0947 \u0932\u094b\u0917\u094b\u0902 \u0915\u0947 \u0938\u093e\u0925 \u0915\u094b\u0908 \u092d\u0940 \u0935\u094d\u092f\u0915\u094d\u0924\u093f \u091c\u094b \u092c\u093e\u0932 \u0935\u093f\u0935\u093e\u0939 \u0915\u0940 \u0907\u091c\u093e\u091c\u093c\u0924 \u0926\u0947\u0924\u093e \u0939\u0948, \u0909\u0938\u0947 \u0915\u093e\u0928\u0942\u0928 \u0915\u0947 \u0905\u0928\u0941\u0938\u093e\u0930 \u0938\u091c\u093e \u0926\u0940 \u091c\u093e\u092f\u0917\u0940\u0964",i,i,!0),A.a_("In case it is happening to you, you can contact the nearest police station, NGO, lawyer, or the child helpline number 1098.","\u0905\u0917\u0930 \u0906\u092a\u0915\u0947 \u0938\u093e\u0925 \u0910\u0938\u093e \u0939\u094b \u0930\u0939\u093e \u0939\u0948 \u0924\u094b \u0906\u092a \u092a\u093e\u0938 \u0915\u0947 \u092a\u0941\u0932\u093f\u0938 \u0938\u094d\u091f\u0947\u0936\u0928, \u090f\u0928\u091c\u0940\u0913, \u0935\u0915\u0940\u0932 \u092f\u093e \u091a\u093e\u0907\u0932\u094d\u0921 \u0939\u0947\u0932\u094d\u092a\u0932\u093e\u0907\u0928 \u0928\u0902\u092c\u0930 1098 \u092a\u0930 \u0938\u0902\u092a\u0930\u094d\u0915 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902\u0964",i,i,!0),A.a_(b,a,h,i,!1),A.a_("You can also choose not to file an official complaint; reporting a crime is your decision. If someone you know is being forced to marry, you should not report the incident without their permission.",b1,i,i,!0),A.a_(f,b1,g,i,!0)],c4),!0,"assets/images/title/ima7.png","Forced Marriage","\u091c\u092c\u0930\u0928 \u0935\u093f\u0935\u093e\u0939",i)
l=A.a([A.cs(i,!0,"Forcing a woman into prostitution, and running a brothel is a criminal offence and is punishable under Indian laws. It is also an offence when someone attempts to do this.","\u090f\u0915 \u092e\u0939\u093f\u0932\u093e \u0915\u094b \u0935\u0947\u0936\u094d\u092f\u093e\u0935\u0943\u0924\u094d\u0924\u093f \u0915\u0947 \u0932\u093f\u090f \u092e\u091c\u092c\u0942\u0930 \u0915\u0930\u0928\u093e, \u0914\u0930 \u090f\u0915 \u0935\u0947\u0936\u094d\u092f\u093e\u0932\u092f \u091a\u0932\u093e\u0928\u093e \u090f\u0915 \u0905\u092a\u0930\u093e\u0927 \u0939\u0948 \u0914\u0930 \u092d\u093e\u0930\u0924 \u0915\u0947 \u0915\u093e\u0928\u0942\u0928\u094b\u0902 \u0915\u0947 \u0924\u0939\u0924 \u0910\u0938\u093e \u0915\u0930\u0928\u0947 \u092a\u0930 \u0938\u091c\u093e \u0926\u0940 \u091c\u093e \u0938\u0915\u0924\u0940 \u0939\u0948\u0964 \u091c\u092c \u0915\u094b\u0908 \u0910\u0938\u093e \u0915\u0930\u0928\u0947 \u0915\u0940 \u0915\u094b\u0936\u093f\u0936 \u0915\u0930\u0924\u093e \u0939\u0948 \u0924\u094b \u092f\u0939 \u092d\u0940 \u0905\u092a\u0930\u093e\u0927 \u0939\u0948\u0964")],c0)
